  \"radlex\",\n\t\"isopen\": true,\n\t\"url\": null,\n\t\"notes\": \"<p>RadLex is
  a controlled terminology for radiology and serves as a single unified source of
  radiology terms for radiology practice, education, and research. RadLex is a comprehensive
  lexicon for standardized indexing and retrieval of radiology information resources.
  With more than 30,000 terms, RadLex satisfies the needs of software developers,
  system vendors and radiology users by adopting the best features of existing terminology
  systems while producing new terms to fill critical gaps. RadLex also provides a
  comprehensive and technology-friendly replacement for the ACR Index for Radiological
  Diagnoses. It unifies and supplements other lexicons and standards, such as SNOMED-CT,
  LOINC, and DICOM. As images, image reports, and medical records continue to move
  online RadLex meets the need of physicians to organize and retrieve image data using
  a common set of terms.&#13;<br />n&#13;<br />nRadReport is a radiology reporting
  initiative that is a part of RadLex. RadReport aims to improve reporting practices
  by creating a library of clear and consistent report templates.  Report templates
  and information about RadReport is available at the link in Resource 2.&#13;<br
  />n&#13;</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
